import React from 'react';

function Skills() {
  return (
    <section id="skills" data-aos="fade-left">
      <h2>기술 스택</h2>
      <ul>
        <li>HTML, CSS, JavaScript</li>
        <li>React</li>
        <li>Node.js, Express</li>
      </ul>
    </section>
  );
}

export default Skills;
